import React from "react";
import { TTodo } from "../types";

type FiltersProps = {
  todos: TTodo;
};

export default function Filters({ todos }: FiltersProps) {
  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input type="checkbox" />
          <span>Completed</span>
        </label>
        <label>
          <input type="checkbox" />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
